## Tooltip

A tooltip is a small box that appears when you hover over an element. It is used to provide additional information about the element.

## React Context

React Context is a way to pass data from a parent component to a child component without having to pass the data through every level of the component tree. It is useful for passing data that is needed by many components, such as theme data or user data.

## Creating a Tooltip using React Context

To create a Tooltip using React Context, we will first create a context using the `createContext` function from React. We will then create a `TooltipProvider` component that will wrap our app and provide the context value. The context value will be an object that contains a `showTooltip` function and a `tooltipData` object. The `showTooltip` function will be used to show the tooltip, and the `tooltipData` object will contain the data for the tooltip.

Here is an example of how to create a Tooltip using React Context:

```
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltipData, setTooltipData] = useState(null);

  const showTooltip = (data) => {
    setTooltipData(data);
  };

  const hideTooltip = () => {
    setTooltipData(null);
  };

  return (
    <TooltipContext.Provider value={{ showTooltip, hideTooltip, tooltipData }}>
      {children}
    </TooltipContext.Provider>
  );
};

const Tooltip = () => {
  const { tooltipData, hideTooltip } = useContext(TooltipContext);

  if (!tooltipData) {
    return null;
  }

  return (
    <div className="tooltip" onMouseLeave={hideTooltip}>
      {tooltipData.content}
    </div>
  );
};

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <button onClick={() => showTooltip({ content: 'Hello, World!' })}>
          Show Tooltip
        </button>
        <Tooltip />
      </div>
    </TooltipProvider>
  );
};
```

In this example, we have created a `TooltipContext` using the `createContext` function from React. We have also created a `TooltipProvider` component that provides the context value. The context value contains a `showTooltip` function, a `hideTooltip` function, and a `tooltipData` object.

The `Tooltip` component uses the `useContext` hook to get the context value. If the `tooltipData` object is `null`, the component returns `null`. Otherwise, it returns a `div` element with the tooltip content.

The `App` component wraps the app in the `TooltipProvider` component and renders a button that calls the `showTooltip` function when clicked. It also renders the `Tooltip` component.

## Closing the Previously Opened Tooltip

To close the previously opened tooltip when a new tooltip is opened, we can modify the `showTooltip` function to hide the previous tooltip before showing the new tooltip. We can do this by calling the `hideTooltip` function before setting the `tooltipData` object.

Here is an example of how to modify the `showTooltip` function to close the previously opened tooltip:

```
const showTooltip = (data) => {
  hideTooltip();
  setTooltipData(data);
};
```

With this modification, the `showTooltip` function will first hide the previous tooltip by calling the `hideTooltip` function, and then it will show the new tooltip by setting the `tooltipData` object.

