You can use the `sort()` method on the `tbody` element.

To sort on a specific column, add a class to the `<th>` and `<td>` elements for that column, and use that to get the elements to sort.

```
function sortTable(table, column) {
  var tbody = table.querySelector("tbody");
  var rows = Array.from(tbody.rows);
  rows.sort(function(a, b) {
    var td1 = a.querySelector("." + column);
    var td2 = b.querySelector("." + column);
    if (td1.tagName == "TD") {
      return td1.textContent.localeCompare(td2.textContent);
    } else {
      return td1.value - td2.value;
    }
  });
  tbody.innerHTML = "";
  for (var i = 0; i < rows.length; i++) {
    tbody.appendChild(rows[i]);
  }
}

